CREATE KEYSPACE Movie_activity
  WITH REPLICATION = { 
   'class' : 'SimpleStrategy', 
   'replication_factor' : 2 
  };

USE Movie_activity;

create table USER (
   USER_ID              int,
   NAME                 text,
   SURNAME              text,
   AGE                  int,
   primary key (USER_ID)
);

create table MOVIE (
   MOVIE_ID             int,
   PRODUCER          	text,
   STUDIO 				text,
   STUDIO_CREATOR 		text,
   TYPE              	text,
   RATINGS              int,
   RELEASE_DATE         date,
   FILM_DESC            text,
   primary key (MOVIE_ID)
);

create table ACTIVITY (
   MOVIE_ID          	int,
   USER_ID              int,
   NAME            		text,
   SURNAME              text,
   AGE 					int,
   DTTM 				timestamp,
   primary key (MOVIE_ID)
);

